import React from 'react';
import styled from 'styled-components';

const RangeSlider = styled.div`
  position: relative;
  width: 80px;
  height: 20px;
  position: fixed;
  bottom: 20px;
  left: 20px;

  input {
    width: 100%;
    position: absolute;
    top: 50%;
    z-index: 3;
    transform: translateY(-50%);
    -webkit-appearance: none;
    appearance: none;
    width: 100%;
    height: 4px;
    opacity: 0;
    margin: 0;
  }
`;

export default function RangeSlideBar() {
  return (
    <RangeSlider>
      <div id='slider_thumb' class='range-slider_thumb'></div>
      <div class='range-slider_line'>
        <div id='slider_line' class='range-slider_line-fill'></div>
      </div>
      <input
        id='slider_input'
        class='range-slider_input'
        type='range'
        value='20'
        min='0'
        max='100'
      />
    </RangeSlider>
  );
}
